import React from "react";
import "./about_me.css";

function aboutMe() {
  return (
    <div className="about">
      <div className="about-title">
        <h1>About me</h1>
        <img src="" alt="" />
      </div>
      <div className="about-sections">
        <div className="about-left">
          <img src="" alt="" />
        </div>
      </div>
    </div>
  );
}

export default aboutMe;
